import React from 'react'
import './mycss.css'
import './creative.min.css'
import LogoComponent from './logo/LogoComponent'
import AboutContainer from './about/AboutContainer'
import {Route,NavLink, Switch } from 'react-router-dom'

class HeaderComponent extends React.Component{
    state = {
        userid : 56789
    }

    //function clickevent
    clickevent = () =>{
    alert("Data deleted")
}

   //function updateEvent
    updateEvent = () =>{
        this.setState({userid : 99999})
    }

    render(){
        return(

           <div>
            <header className="logo">
          <LogoComponent/>
          <div>
            
                <a href ="about">ABOUT US</a> <br></br>
                <a href="team">Our Team</a>
            </div>
            <Route path="/about" component={AboutContainer}/>
            <div class="something">This is my header section</div>
            <p>{this.state.userid}</p>
            <h1>{this.props.username}</h1>
             
        <h2>{this.props.address}</h2>
        <button onClick={this.clickevent}>DELETE</button><br></br>
        <button onClick={this.updateEvent}>UPDATE</button>
            </header>
        
       
        </div>
        )
     
        
        // <Route path="/team" component={Te}
    }
}


export default HeaderComponent
